import './App.css';

function App() {
	return (
		<div className="App">
			<header className="header">
				<h1>Hyeri Portfolio</h1>
			</header>

			<div className="container">
				<nav className="nav">
					<ul>
						<li>Home</li>
						<li>About</li>
						<li>Contact</li>
					</ul>
				</nav>

			</div>
		</div>
	);
}

export default App;
